import React from 'react'
import { Card } from "./Card";
import RouteCreate from '../images/RouteCreate.png'
import Routeimg from '../images/Myrotes.png'
import RouteMap from '../images/RouteMap.png'

export  function Cards() {

    const cards = [
        {
            id: 1,
            title: "My Routes",
            Image: Routeimg,
        },
        {
            id: 2,
            title: "Create Route",
            Image: RouteCreate,
        },
        {
            id: 3,
            title: "Map",
            Image: RouteMap,
        }
    ]

  return (
    <div>
        <div className='row' >
            <div className='col-md-4'>
                <Card />
            </div>
            <div className='col-md-4'>
                <Card />
            </div>
            <div className='col-md-4'>
                <Card />
            </div>
        </div>
    </div>
  )
}
